    false,nt"url": null,nt"notes": "This map layer contains information on
    costly regional landslide events in the 50 United States and Puerto Rico. The extents
    of the regional events were drawn from the published literature and represent the
    approximate boundaries of extensive landsliding triggered by a single meteorological
    or seismic event. The regional extents should be considered approximate. In several
    cases the limits shown represent an arbitrary administrative boundary rather than
    the extent of landsliding related to a storm or earthquake. Costly events are defined
    as those where there was public or private property damage or loss of human life.
    Landslides are defined in a broad manner, to include most types of gravitational
    mass movement such as rockfalls, debris flows, and the failure of engineered soil
    materials. Landslide causes include earthquakes, reservoir draw-downs, and heavy
    precipitation. This is an updated version of the April 2001 map layer.",nt"license_title":
